class Solution1 {
public:
    int checkPanlidrom(const string& s, int center, bool include) {
        int i = center;
        int j = center + 1;
        if (!include)
            i--;
        while (i >= 0 && j < s.size() && s[i] == s[j]) {
            i--;
            j++;
        }
        if (i == -1) {
            if (include) {
                return s.size() - center - center - 2;
            } else {
                return s.size() - center - center - 1;
            }
        }
        return -1;
    }
    string shortestPalindrome(string s) {
        int n = s.size();
        if (n == 0)
            return s;
        if (checkPanlidrom(s, (s.size() - 1) / 2, !(s.size() & 1)) == 0) {
            return s;
        }
        int min_length=9999999;
        int min_center = 0;
        bool include = true;
        int i = 0;
        while (i <= (n - 1) / 2) {
            for (int jj = 0; jj < 2; jj++ ) {
                int t = checkPanlidrom(s, i, jj);
                if (t != -1 && t < min_length) {
                    min_length = t;
                    min_center = i;
                    include = jj;
                }
            }
            i++;
        }
        // cout << "center " << min_center << " len " << min_length << endl;
        string prefix = s.substr(s.size() - min_length, min_length);
        reverse(prefix.begin(), prefix.end());
        return prefix + s;
    }
};

class Solution {
    public:
    string shortestPalindrome(string s)
    {
        int n = s.size();
        string rev(s);
        reverse(rev.begin(), rev.end());
        string s_new = s + "#" + rev;
        int n_new = s_new.size();
        vector<int> f(n_new, 0);
        for (int i = 1; i < n_new; i++) {
            int t = f[i - 1];
            while (t > 0 && s_new[i] != s_new[t])
                t = f[t - 1];
            if (s_new[i] == s_new[t])
                ++t;
            f[i] = t;
        }
        return rev.substr(0, n - f[n_new - 1]) + s;
    }
};
int main(void) {
    Solution s;
    cout << s.shortestPalindrome("aacecaaa") << endl;
    cout << s.shortestPalindrome("abcd") << endl;
    cout << s.shortestPalindrome("") << endl;

    return 0;
}

